import React from 'react'
import { Link } from 'react-router-dom'
import './Navbar.css'

function Navbar() {
    return (
        <nav className='bg-dark'>
            {/* Logo */}
            <Link to="/">
                <img className='navbar-logo' src="http://pngimg.com/uploads/amazon/amazon_PNG11.png" alt='' />
            </Link>

            {/* Search bar */}
            <input className='navbar-input' />
            <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="light" class="bi bi-search" viewBox="0 0 16 16">
                <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001c.03.04.062.078.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1.007 1.007 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0z" />
            </svg>

        </nav>
    )
}

export default Navbar
